import './style.css'
export class index extends Component {
    constructor(props){
		super(props);

	}
    close = () =>{
		this.props.handleClose()
	}
    render() {
        return (
            <div className='modal'>
                <div className='container'>
                    <span onClick={this.close}>&#9747;</span>
                </div>
            </div>
        )
    }
}

export default index
